import React from 'react';
import { Form, FormGroup, Input, Button, Navbar } from 'reactstrap';



export default function NavbarSticky() {

    return (
        <div>
  <Navbar
    color="faded"
    light
  >
    <NavbarBrand
      className="me-auto"
      href="/"
    >
      reactstrap
    </NavbarBrand>
    <NavbarToggler
      className="me-2"
      onClick={function noRefCheck(){}}
    />
    <Collapse navbar>
      <Nav navbar>
        <NavItem>
          <NavLink href="/components/">
            Components
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="https://github.com/reactstrap/reactstrap">
            GitHub
          </NavLink>
        </NavItem>
      </Nav>
    </Collapse>
  </Navbar>
</div>
        // <nav className="navbar" >   {/* className is a keyword that is used to add a class to an element */}
